import './styles/messageslist.css';

const MessagesList = ({messages}) => {
    messages = messages.reverse();
    
    return (
        <div>
            {messages.map((m) => (
                <div key={m.id} className="message">
                    <div>{m.text}</div>
                </div>
            ))}
        </div>
    )
}

export default MessagesList
